import React from "react";
import AppLayout from "./components/AppLayout";
import "./App.css";

function App() {

  return (
    <div className="app-layout">
    <header>
      <Navbar />
    </header>

    <main>
      {content}
    </main>

    <footer>
      <Footer />
    </footer>
  </div>
  );
}

export default App;
